import{_ as e}from"./plugin-vue_export-helper-c27b6911.js";import{o as a,c as i,e as r}from"./app-b92eb86e.js";const l={},o=r('<h1 id="_9-2-9-8-周记" tabindex="-1"><a class="header-anchor" href="#_9-2-9-8-周记" aria-hidden="true">#</a> 9.2-9.8 周记</h1><p>一周已经过去,不管是忙忙碌碌，还是无所作为，反正时间已经过去了，寿命-7天。</p><h2 id="运动" tabindex="-1"><a class="header-anchor" href="#运动" aria-hidden="true">#</a> 运动</h2><p>运动是本周最为尴尬的类目，上周六雄心壮志制定了一周的健身计划。今天反过来一看emm...</p><ol><li>9.3 跑步一次，腹肌轮 0 ， 俯卧撑 0</li><li><strong>体重管理</strong>失败,下班回去以后还是吃了不少的碳水</li><li>陪女朋友下楼散步三次，勉强也算运动了吧。。</li></ol><h2 id="学习" tabindex="-1"><a class="header-anchor" href="#学习" aria-hidden="true">#</a> 学习</h2><ol><li><strong>英语</strong>：坚持背单词5天，周末只打卡没有背单词。听力还是每天坚持听完一个短视频，本周午饭后增加了 口语 的环节。</li><li><strong>代码</strong> : 代码方面0提升，懒惰了不少，不过还是找了一些AI模型玩了一下，在huggleface和modelscope上都有体验，modelscope关于视频方面的模型太少了，现在视频方面的模型都不太行吗？还是单纯国内是这样。</li><li><strong>算法</strong> ：算法抽空开始继续做起来，重刷了 排序、递归 的一些常见题目，手生了。</li></ol><h2 id="生活" tabindex="-1"><a class="header-anchor" href="#生活" aria-hidden="true">#</a> 生活</h2><ol><li>对博客重新改造了一下，主要是排版和图标方面，实在是不喜欢加图标，太丑了。本想做成导航栏和侧边栏联动，无奈前端玩不转，就这样吧。</li><li>第二个就是谈谈最近主机区闹得沸沸扬扬的超级小桀事件。说实话，我个人是觉得超级小桀还是蛮好的，现在都在批他说谎、口嗨....emm。说实话看了这么多年，没觉得他是这样子的一个人。结果各种反转，挺复杂吧。反正我也不是啥死忠粉，还是继续看下饭视频吧</li><li>这两年来，局势越来越差，越来越看不清前方的道路，想做一个缩头乌龟，逃回学校的象牙塔继续学习深造。看着朋友在国外读研，感觉她的生活状态和国内完全不一样了，朋友圈很relax，整个人看着都是那种比较放松，但是又在努力进取的状态，真羡慕。</li><li>打算开始学习obsidian笔记，在互联网呆的时间越久，就越加不敢相信各种云端存储，没有一个是正经公司。还是做好数据迁移吧。</li></ol><h2 id="理财" tabindex="-1"><a class="header-anchor" href="#理财" aria-hidden="true">#</a> 理财</h2><ol><li>股票：目前持仓 京东、小鹏、中国看涨ETF、法拉第未来，卖出sea。<br> 中国看涨ETF 现在还有一点盈利，也想出掉了。看目前美元不断拉伸的情况，出逃的外资会越来越多。 京东现在是啥逻辑，看不明白了 ，为啥会一直在跌， 本以为他季报会比较好，结果股价却是一直在走弱。 小鹏还是比较看好的，中国还是一篇蓝海。继续持有。而且和滴滴联手以后，以后滴滴司机的车型应该会往这边去转。</li></ol>',11),t=[o];function n(h,s){return a(),i("div",null,t)}const _=e(l,[["render",n],["__file","2023-09-08.html.vue"]]);export{_ as default};
